#import "SJTTrafficIndexModel.h"

#import <WebKit/WebKit.h>
#define SCREEN_WIDTH [UIScreen mainScreen].bounds.size.width
#define SCREEN_HEIGHT [UIScreen mainScreen].bounds.size.height
#define LLObjectIsNil(__object) ((nil == __object) || [__object isKindOfClass:[NSNull class]])
#define LLStringIsEmpty(__string) ((__string.length == 0) || LLObjectIsNil(__string))
#define LLStringIsNotEmpty(__string)  (!LLStringIsEmpty(__string))
#define LLArrayIsEmpty(__array) ((LLObjectIsNil(__array)) || (__array.count==0))


@interface ViewController ()<WKNavigationDelegate>
@property (nonatomic,strong)WKWebView *webView;
//全市
@property (nonatomic,strong)NSMutableString *wholeCity;
//中心城区
@property (nonatomic,strong)NSMutableString *centerCity;
//骨干城区
@property (nonatomic,strong)NSMutableString *backboneCity;
//横坐标
@property (nonatomic,strong)NSMutableString *createTime;
@end

@implementation ViewController

- (void)viewDidLoad {
    [super viewDidLoad];
    [self configUI];
    [self test];
    // Do any additional setup after loading the view.
}

/**
 初始化页面
 */
-(void)configUI{
    self.wholeCity = [[NSMutableString alloc] init];
    self.centerCity = [[NSMutableString alloc] init];
    self.backboneCity = [[NSMutableString alloc] init];
    self.createTime = [[NSMutableString alloc] init];
    
    NSString *path = [[NSBundle mainBundle] pathForResource:@"jiaotongzaishou" ofType:@"html"];
    self.webView = [[WKWebView alloc] initWithFrame:CGRectMake(0, 0, SCREEN_WIDTH,300*SCREEN_WIDTH/375.0)];
    self.webView.scrollView.scrollEnabled = NO;
    [self.webView sizeToFit];
    self.webView.navigationDelegate = self;
    
        if ([[UIDevice currentDevice].systemVersion floatValue] >= 9.0) {
            NSURL *fileURL = [NSURL fileURLWithPath:path];
            [self.webView loadFileURL:fileURL allowingReadAccessToURL:fileURL];
       }
    [self.view addSubview: self.webView];
}

-(void)webView:(WKWebView *)webView didFinishNavigation:(WKNavigation *)navigation{
    
    
    
    if (LLStringIsNotEmpty(self.centerCity)) {
        [webView evaluateJavaScript:[NSString stringWithFormat:@"setCenterCity([%@])",self.centerCity] completionHandler:^(id _Nullable result, NSError * _Nullable error) {
            NSLog(@"qll - centerCity%@",error);
        }];
    }
    
    if (LLStringIsNotEmpty(self.backboneCity)) {
        [webView evaluateJavaScript:[NSString stringWithFormat:@"setBackboneCity([%@])",self.backboneCity] completionHandler:^(id _Nullable result, NSError * _Nullable error) {
            NSLog(@"qll - backboneCity%@",error);
            
        }];
    }
    
    if (LLStringIsNotEmpty(self.wholeCity)) {
        [webView evaluateJavaScript:[NSString stringWithFormat:@"setWholeCity([%@])",self.wholeCity] completionHandler:^(id _Nullable result, NSError * _Nullable error) {
            NSLog(@"qll - wholeCity%@",error);
            
        }];
    }
    if (LLStringIsNotEmpty(self.createTime)) {
        
        [webView evaluateJavaScript:[NSString stringWithFormat:@"setXAxis([%@])",self.createTime] completionHandler:^(id _Nullable result, NSError * _Nullable error) {
            NSLog(@"qll - createTime%@",error);
            
        }];
    }
    [webView evaluateJavaScript:@"update()" completionHandler:^(id _Nullable result, NSError * _Nullable error) {
    }];
}

