     id  responseObject =  [json mj_JSONObject];
        if([responseObject[@"returnCode"] intValue] == 1){
            NSArray *responseArray = [SJTTrafficIndexModel mj_objectArrayWithKeyValuesArray:responseObject[@"data"]];
            if (LLArrayIsEmpty(responseArray)) {
                return ;
            }
            
            for (SJTTrafficIndexModel *trafficIndexModel in responseArray) {
                //                @autoreleasepool{
                if ([trafficIndexModel.sectname isEqualToString:@"全市"]) {
                    [self.wholeCity appendString:[NSString stringWithFormat:@"'%@',", trafficIndexModel.conindex]];
                    NSArray *timeArray = [[trafficIndexModel.createTime componentsSeparatedByString:@" "][1] componentsSeparatedByString:@":"];
                    [self.createTime appendString:[NSString stringWithFormat:@"'%@:%@',",timeArray[0],timeArray[1]]];
                }
                
                if ([trafficIndexModel.sectname isEqualToString:@"中心城区"]) {
                    [self.centerCity appendString:[NSString stringWithFormat:@"'%@',", trafficIndexModel.conindex]];
                }
                if ([trafficIndexModel.sectname isEqualToString:@"全市主骨干网"]) {
                    [self.backboneCity appendString:[NSString stringWithFormat:@"'%@',", trafficIndexModel.conindex]];
                }
                //                };
            }
            if (LLStringIsNotEmpty(self.centerCity)) {
                [self.centerCity deleteCharactersInRange:NSMakeRange(self.centerCity.length -1, 1)];
                
            }
            
            if (LLStringIsNotEmpty(self.backboneCity)) {
                [self.backboneCity deleteCharactersInRange:NSMakeRange(self.backboneCity.length -1, 1)];
            }
            
            if (LLStringIsNotEmpty(self.wholeCity)) {
                [self.wholeCity deleteCharactersInRange:NSMakeRange(self.wholeCity.length -1, 1)];
            }
            
            if (LLStringIsNotEmpty(self.createTime)) {
                [self.createTime deleteCharactersInRange:NSMakeRange(self.createTime.length -1, 1)];
            }
            
            [self.webView reload];
        }
